import React from 'react';
import {sum,sub,div,mul} from './Header';

function App(){
    return (
        <>
            <h1>Make {c}}</h1>
            <h1>Make sum of two ={sum(12,12)}</h1>
            <h1>Make mul of two ={mul(12,12)}</h1>
            <h1>Make div of two ={div(12,12)}</h1>
            <h1>Make sub of two ={sub(12,12)}</h1>
        </>
    );
}
export default App;
